import Button from "./Button";
import Card from "./Card";

function Users({ name, job }) {
  return (
    <div>
      <Card>
        <div>
          <h1>Name: {name}</h1>
          <h3>Job: {job}</h3>
          <Button>{children}</Button>
        </div>
      </Card>
    </div>
  );
}

export default Users;
